import React, { Component }  from 'react';

class LoadData extends Component {

    componentDidMount(){
        this.props.getData() 
    }

    render() {
        const {data} = this.props.data

        return(
            <div>
                {data.map(item => 
                    <div key={item.id}>
                        <p>{item.id}</p> 
                    </div>
                )}
            </div>
        )
    }
}

export default LoadData
